import React, {Component} from "react";

class Contact extends Component{
    render(){
        return(
            <div>
                <h2>Contact me</h2>
                <p>This is my conatct</p>
                <p>You can email me to @deepanc2001@gmail.com</p>
            </div>
        )
    }
}
export default Contact;
